import React from 'react'
import { StyleSheet, Text, View } from "react-native";

const HiddenItem = () => (
	<View>
	  <Text>Background field</Text>
	</View>
 );

 const styles = StyleSheet.create({
	container: {
	  flex: 2,
	  flexDirection: 'column',
	  marginBottom: 10,
	  padding: 5,
	},
 });
export default HiddenItem
